import React, { Component } from 'react'
import { Fragment } from 'react'
import dataCar from "../carsData/carsData.json";

export class CarSignleAudi1 extends Component {
    render() {
        return (
            <Fragment>
                <div className="container mb-5 mt-5">
                    <div className="row">
                        <img className="col-lg-4" src={dataCar[0].img} alt={dataCar[0].name} width="600px" />
                        <div className="col-lg-8">
                            <h2>{dataCar[0].name}</h2>
                        </div>
                    </div>
                </div>
            </Fragment>
        )
    }
}

export default CarSignleAudi1
